import React from "react";
import styled from "styled-components";

const DetailInform = () => {
    const handleChange = () => {};
    return (
        <Wrapper>
            <Title>Personal Details</Title>
            <WrapInfo>
                <Header>Full name</Header>
                <input type='text' />
                <Header>Gender</Header>
                <input type='text' />
                <Header>Address</Header>
                <input type='text' />
                <Header>Mail</Header>
                <input type='text' />
                <Header>Phone</Header>
                <input type='text' />
            </WrapInfo>
        </Wrapper>
    );
};

const Wrapper = styled.div``;
const Title = styled.div`
    font-size: 22px;
    font-weight: bold;
`;
const WrapInfo = styled.div`
    padding: 1rem 0;

    input {
        border-radius: 4px;
        border: 1px solid black;
        padding: 5px 4px;
        font-size: 14px;
        font-weight: 500;
    }
`;
const Header = styled.div`
    text-transform: uppercase;
    font-size: 12px;
    font-weight: bold;
    padding: 3px 0;
`;

export default DetailInform;
